import React from 'react';
import './Banner.css';

function Banner() {
  return (
    <div class="banner">
      <img id="logo" src={require('../')} alt ="Banner Background for Sextant Network Dashboard" />
      <img id="bground" src="" alt ="Banner Background for Sextant Network Dashboard" />
      <h1> Sextant Network Dashboard </h1>
    </div>
  );
}

export default Banner
